#!/usr/bin/python3


input = ''


differenceAa = ord('a') - ord('A')

i = 0

while i < len(input) - 1:
    if abs(ord(input[i]) - ord(input[i+1])) == differenceAa:
        shortend = input[:i]
        if len(input) > i + 2:
            shortend += input[i+2:]
        input = shortend
        i -= 1
        i = max(0, i)
        print(len(input), i)
    else:
        i += 1


print(len(input))
print(input)


